import React from "react";
import styled from "styled-components";


const Homepage = () => {
  return (
    <>
      <Wrapper>
          Homepage
      </Wrapper>
    </>
  );
};

const Wrapper = styled.div`
  background-image: url("./assets/tony-anananana-qOXWUIDZOqM-unsplash.jpg");
  height: 100vh;
`;

export default Homepage;
